#WAP to find the max consecutive of an given array
class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        """
          :type nums: List[int]
          :rtype: int
          """
        b=0
        count=0
        for i in nums:
             if i==1:
                  count+=1
             else:
                  if b<count:
                       b=count
                       count=0
                  else:
                      count=0
        if count>b:
             print('max consecutive 1s are :', count)
        else:
             print('max 1s are:', b)

